style.css:
/* Apply a basic style to all elements */
body {
    font-family: Arial, sans-serif;
    background-color: #f2f2f2;
    color: #333;
    margin: 0;
    padding: 20px;
    text-align: center;
}

/* Style headings */
h1 {
    color: #007bff;
}

/* Style links */
a {
    color: #007bff;
    text-decoration: none;
}

/* Style links on hover */
a:hover {
    text-decoration: underline;
}
